const Pokemon = ({ pokemon }) => {
    const { sprites } = pokemon
    const set
    Object.keys(sprites).forEach(key => {
        [...set, sprites[key]]
    })

    return (
        <div>
            Pokemon
        </div>
    )
}

export default Pokemon
